How to avoid adding duplicate objects to an array in MongoDB<p>this is my schema:</p>

<pre><code> new Schema({
    code: { type: String },
    toy_array: [
      {
        date:{
        type:Date(),
        default: new Date()
       }
        toy:{ type:String }
    ]
   }
</code></pre>

<p>this is my db:</p>

<pre><code>{
  "code": "Toystore A",
  "toy_array": [
    {
      _id:"xxxxx", // automatic
      "toy": "buzz"
    },
    {
      _id:"xxxxx", // automatic
      "toy": "pope"
    }
  ]
},
{
  "code": "Toystore B",
  "toy_array": [
    {
       _id:"xxxxx", // automatic
      "toy": "jessie"
    }
  ]
}
</code></pre>

<p>I am trying to update an object. In this case I want to update the document with <code>code: 'ToystoreA'</code> and add an array of subdocuments to the array named <code>toy_array</code> if the toys does not exists in the array.</p>

<p>for example if I try to do this:</p>

<pre><code>db.mydb.findOneAndUpdate({
  code: 'ToystoreA,
  /*toy_array: {
    $not: {
      $elemMatch: {
        toy: [{"toy":'woddy'},{"toy":"buzz"}],
      },
    },
  },*/
},
{
  $addToSet: {
    toy_array: {
      $each: [{"toy":'woddy'},{"toy":"buzz"}],
    },
  },
},
{
  new: false,
}
})
</code></pre>

<p>they are added and is what I want to avoid.</p>

<p>how can I do it?</p>

<pre><code>[
  {
    "code": "Toystore A",
    "toy_array": [
      {
        "toy": "buzz"
      },
      {
        "toy": "pope"
      }
    ]
  },
  {
    "code": "Toystore B",
    "toy_array": [
      {
        "toy": "jessie"
      }
    ]
  }
]
</code></pre>

<p>In this example <code>[{"toy":'woddy'},{"toy":"buzz"}]</code> it should only be added <code>'woddy'</code> because <code>'buzz'</code> is already in the array.</p>

<p>Note:when I insert a new <code>toy</code> an insertion date is also inserted, in addition to an _id (it is normal for me).</p>

