Updating mongoose nested array of mixed types<p>I have a mongoose schema of mixed types like so:</p>

<pre><code>const user = mongoose.Schema({
    ...
    "links" : []
    ...
</code></pre>

<p>After populating this schema, I ended up with data like so:</p>

<pre><code>[
    [
        {
            "step1": "post-url-google", // This field is unique for each entry
            "step2": {
                "title": "Heading 1",
                "likes": 4
            }
        },
    ],

    [
        {
            "step1": "post-url-microsoft",
            "step2": {
                "title": "Heading 1",
                "likes": 1
            }
        },

        {
            "step1": "post-url-apple",
            "step2": {
                "title": "Heading 2",
                "likes": 6 // I want to update this to 7
            }
        }
    ]
]
</code></pre>

<p>What I want to achieve is to update the <code>"step1": "post-url-apple"</code> field from 6 to have a <code>likes</code> of 7
So I tried using the <code>User.save()</code> function like so:</p>

<pre><code>let user = await User.findOne({"_id" : "some_id"})

user.links[1].some(object =&gt; {
    if (object.step1 === "post-url-apple") {
        object.step2.likes = 7
        (async function (){
            user.save() // I also did error handling
        })()
        return
    }
})
</code></pre>

<p>This method works fine and the user gets updated but it keeps throwing <code>ParallelSaveError</code> possibly because I am calling the <code>save()</code> function in parallel on the same user instance in some other parts of my code.</p>

<p>So I decided to use the <code>User.findOneAndUpdate()</code> method, but my queries keep failing when using the mongodb dot notation <code>$[&lt;identifier&gt;]</code>, obviously because I don't know how to use it properly.</p>

<p>Like so: </p>

<pre><code>let update = {
    "$set" : { 
        "links.$[index1].$[index2].step2.likes" : 7,
    }
}

let conditions = {
    arrayFilters : [
        {"index1" : 1},
        {"index2.step1" : "post-url-apple"}
    ]
}

try {
    let result = await Users.findOneAndUpdate({"_id" : "some_id"}, update, conditions)
    console.log(result)
} catch (err) {
    console.log(err)
}
</code></pre>

<p>For all good reasons, I'm not hiting the catch block but the update was equally not successful</p>

<p>How do I achieve updating the <code>"step1": "post-url-apple"</code> <code>likes</code> field to 7 using <code>findOneAndUpdate</code>?</p>

<p>Thank you.</p>

